// ProductDetail.js
import React from 'react';

const ProductDetail = ({ match }) => {
    const { id } = match.params;

    // Здесь вы можете использовать id для загрузки данных о конкретном товаре из API и отображения их на странице

    return (
        <div>
            <h2>Product Details</h2>
            <p>Product ID: {id}</p>
            {/* Дополнительные детали товара */}
        </div>
    );
}

export default ProductDetail;
